import logo from './logo.png';
import logo_perfil from './logo_perfil.png';


const img_home = [
    {
        "img": logo,
        "alt": "Logo personal"
    },
    {
        "img": logo_perfil,
        "alt": "Imágene de perfil del usuario"
    }
];


export default img_home;
